import React, {useState} from 'react'
import Acard from './Acard'

const ATM = () => {
    const [atm, setAtm] = useState([
        {
        id:1,
        image:'ATM_card',
        text:'This month',
        num:'$16,982.20'
      },
      {
        id:2,
        text:'Total earning',
        num:'$13,690',
        num1:'36%'
      }
    ])
  return (
    <div>
        <Acard codes={atm} />
        </div>
  )
}

export default ATM
